import {Listbox, ListboxItem} from "@nextui-org/react";
import React from "react";
import {Outlet} from "react-router-dom";

function Layout() {
    return (
        <>
            <header className="w-full flex justify-center items-center gap-5 py-5 bg-[#333] text-white">
                Header
                <ListBoxWrapper>
                    <Listbox
                        aria-label="Actions"
                        onAction={(key) => alert(key)}
                    >
                        <ListboxItem key="new">New file</ListboxItem>
                        <ListboxItem key="copy">Copy link</ListboxItem>
                        <ListboxItem key="edit">Edit file</ListboxItem>
                        <ListboxItem key="delete" className="text-danger" color="danger">
                            Delete file
                        </ListboxItem>
                    </Listbox>
                </ListBoxWrapper>
            </header>
            <div className="w-full flex justify-center py-5">
                <Outlet/>
            </div>
            <footer className="w-full flex justify-center py-5 bg-[#333] text-white">
                Footer
            </footer>
        </>
    );
}

interface ListBoxWrapperProps {
    children: React.ReactNode;
}

export const ListBoxWrapper = ({children}:ListBoxWrapperProps) => (
    <div className="w-full max-w-[260px] border-small px-1 py-2 rounded-small border-default-200 dark:border-default-100">
        {children}
    </div>
);

export default Layout;
